import axios from 'axios'

export default class Classes {

    getAllClasses(classId) {
        const classes = axios.get('http://localhost:8080/classes/getAllClasses?classId=' + classId)
        return classes
    }

    createClass(body) {
        const response = axios.post('http://localhost:8080/classes/createClass', body)
        return classes
    }

    async getMoviesFromApi() {
        try {
          let response = await fetch('http://localhost:8080/classes/getAllClasses?classId=' + classId);
          let responseJson = await response.json();
          return responseJson.classes;
         } catch(error) {
          console.error(error);
        }
      }

